import {Card, Button} from 'react-bootstrap';
import moviecard from '../css/style.css'
import React, {useState,useEffect}from 'react'

function Movies() {
    const [data, setData] = useState([]);
  const getData = () => {
    fetch("movie.json")
      .then((response) => response.json())
      .then((movies) => setData(movies));
  };

  useEffect(() => {
    getData();
  }, []);

  console.log(data);
  return data.map((el) => (
    <div className="col-3 mt-4">
        <Card>
  <Card.Img variant="top" src={el.posterUrl} className="imgcard"/>
  <Card.Body>
    <Card.Title>{el.title}</Card.Title>
    <Card.Text>
    {el.plot}
    </Card.Text>
  </Card.Body>
</Card>
    </div>
  ));

 }

export default Movies
